description:
Little men in my jar! Smoke torment..
I was hoovering today and guess what caught in my pipe!?.. little men... I've popped them into my high sided glass jar and now I'm going to smoke them out with my roll up! Blowing my putrid smoke into the jar where those little men are stuck.. Those little men are going to in my jar with the amount of smoke I blow in there, they only have small lungs after all!

